import React from "react";
import Logo from "../Logo";
import MenuItem from "../MenuItem";
import ToggleConnection from "../ToggleConnection";

const MenuContainer = (props) => {
  let items = [<MenuItem title="Home" iconName="fa-house" />];
  if (props.token) {
    items.push(<MenuItem title="Notifications" iconName="fa-bell" />);
    items.push(<MenuItem title="Messages" iconName="fa-envelope" />);
    items.push(<MenuItem title="Profile" iconName="fa-user" />);
    items.push(<MenuItem title="More" iconName="fa-ellipsis" />);
  }

  return (
    <aside className="menu">
      <Logo />
      <div className="items">
        <MenuItem title="Home" iconName="fa-house" />
        {props.token && (
            <MenuItem title="Notifications" iconName="fa-bell" />
          ) && <MenuItem title="Messages" iconName="fa-envelope" /> && (
            <MenuItem title="Profile" iconName="fa-user" />
          ) && <MenuItem title="More" iconName="fa-ellipsis" />}
      </div>
      <ToggleConnection token={props.token} />
    </aside>
  );
};

export default MenuContainer;
